import React from "react";
import TodoItem from "./components/TodoItem";
import ContactCard from "./components/ContactCard";

function App() {
  return (
    <div>
      <div>
        <TodoItem />
        <TodoItem />
        <TodoItem />
        <TodoItem />
      </div>

      <div className="contacts">
        <ContactCard />
        <ContactCard />
        <ContactCard />
        <ContactCard />
        <ContactCard />
      </div>
    </div>
  );
}

export default App;
